    text-decoration: overline;
}
#lt{
    text-decoration: line-through;
}
#ul{
    text-decoration: underline;
}
.linkblock{
    display: block;
    text-decoration: none;
    width: 80px;
    margin: 4px;
}
.linkblock a{
    text-decoration: none;
    color: unset;
}
.linkblock a:hover{
    background-color: slategrey;
}
#github{
    color: white;
}
#bili{
    color: white;
}
@media (max-width: 1000px){
    #content{
        margin-left: 5%;
        width: 90%;
        font-size: 30px;
    }
    .sidebar{
        width: 80%;
        transition: none;
    }
    .sidebarhidden{
        width: 0%;
    }
}

